import React from 'react';
import { PageBanner,Counter, AboutComp,Features,Team,Review}  from '../layouts/about/index';
import Layout from '../../common/Layout';
 import About01 from '../layouts/about/About01';


const AboutMain = () => {
    return (
        <div className="about"> 
  
            <Layout>  
                <About01 />
                    <PageBanner
                        title="About us"
                        rootUrl="/"
                        parentUrl="Home"
                        currentUrl="About"
                        />
                    <Features />
                    <Team />
                    <Counter />
                    <AboutComp />
                    <Review />
            </Layout>
        </div>
    );
}

export default AboutMain;
